import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <nav>
        <h1>React Fun Facts</h1>
        <ul>
          <li>About</li>
          <li>Pricing</li>
          <li>Contacts</li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
